const backUrl = "https://jsonplaceholder.typicode.com";

export async function userForm(name, email) {
  const resp = await fetch(`${backUrl}/users`, {
    method: "POST",
    headers: {
      "Content-Type": "application/json",
    },
    body: JSON.stringify({
      name,
      email,
    }),
  });

  const data = await resp.json();
  // console.log(data);
  return data;
}
